import Card from "../components/Card"
import image1 from "../Assets/Albert.jpg"

const cardsData = [
    {
        id: 1,
        title: "In development stage",
        image1: image1
    }
]

function Row() {
    return <div className="container d-flex justify-content-center align-items-center h-100 mt-5">
        <div className="row">
            {
                cardsData.map(card => {
                    <div className="col-md-4" key={card.id}>
                        <Card image={image1} titleText="Default" />
                    </div>
                })
            }
        </div>
    </div>
}

export default Row;
